import React from 'react'

function ListAppHeader() {

    return (
        <header style={headerStyle}>
            <h1>Jeopardy Categories</h1>
        </header>
    )
}

const headerStyle = {
    backgroundColor: '#3C3C3C',
    color: '#FFFFFF',
    padding: '15px'
};

export default ListAppHeader;
